import React from 'react';

export default function Home () {
    return (
        <div style={{
            backgroundColor: 'lavender',
            display: 'flex',
            borderStyle: 'solid',
            borderColor: 'red',
            gridTemplateColumns: 'repeat(3, 1fr)',
            gridTemplateRows: '1fr',
            gridGap: '10px',
            margin: 'auto 0',
            fontSize: '60px',
            justifyContent: 'center',
            alignContent: 'center',
            width: '100%'
              }
        }>
            <h1>TAYLER RADCLIFFE</h1>
        </div>
    )
}
